INSERT INTO insider.announce (ANC_NO, ANC_TITLE, ANC_CONTENT, ANC_DATE, ANC_WRITER, HITS, FILE_PATH) VALUES (125, '개인정보 처리방침 개정안내', '<p><span style="color: rgb(0, 0, 0);">안녕하세요. (주)카카오 입니다.&nbsp;</span></p><p><span style="color: rgb(0, 0, 0);">카카오 기업사이트를 이용해주시는 고객 여러분께 감사드리며, 새로운 개인정보처리방침 시행에 관해 안내 말씀드립니다.</span></p><p><span style="color: rgb(0, 0, 0);">&nbsp;</span></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">1. 변경 내용&nbsp;</strong></p><p><span style="color: rgb(0, 0, 0); background-color: transparent;">•방명록 및 방문자등록시스템이 종료되고, </span><span style="color: rgb(0, 0, 0);">출입증신청시스템이 신규로 추가되어 개인정보 수집 및 이용 내용이 일부 수정되었습니다.</span></p><p><span style="color: rgb(0, 0, 0);">•사옥 종합관리 위탁업무 내용이 일부 추가되었습니다.</span></p><p>&nbsp;</p><p><strong style="color: rgb(0, 0, 0); background-color: transparent;">2. 변경 상세</strong></p><p class="ql-align-center"><strong style="color: rgb(0, 0, 0); background-color: transparent;">변경 전</strong></p><p class="ql-align-center"><strong style="color: rgb(0, 0, 0); background-color: transparent;">변경 후&nbsp;</strong></p><p><span style="color: rgb(0, 0, 0);">본 개인정보처리방침은 회사의 인재영입, IR 미팅 예약 시스템, 사이버윤리실 신고접수, 카카오스페이스 방문접수, 제휴제안, 전자입찰시스템,&nbsp;</span><s style="color: rgb(0, 0, 0);">방명록 및 방문자등록시스템</s><span style="color: rgb(0, 0, 0);">, 카카오 버그바운티, Partner on Kakao, 카카오 테크 캠퍼스, 동반성장 with kakao,&nbsp;부동산자산관리시스템(RAMS)을 이용하고자 하는 이용자(이하 ‘이용자’)에 적용됩니다.</span></p><p><span style="color: rgb(0, 0, 0);">본 개인정보처리방침은 회사의 인재영입, IR 미팅 예약 시스템, 사이버윤리실 신고접수, 카카오스페이스 방문접수, 제휴제안, 전자입찰시스템,&nbsp;</span><strong style="color: rgb(0, 109, 215);">출입증신청시스템</strong><span style="color: rgb(0, 109, 215);">,</span><span style="color: rgb(0, 0, 0);">&nbsp;카카오 버그바운티, Partner on Kakao, 카카오 테크 캠퍼스, 동반성장 with kakao,&nbsp;부동산자산관리시스템(RAMS)을 이용하고자 하는 이용자(이하 ‘이용자’)에 적용됩니다.</span></p><p><strong style="color: rgb(0, 0, 0); background-color: transparent;">1. 개인정보 수집</strong></p><p><strong><s>방명록 및 방문자등록시스템</s>&nbsp;</strong></p><p><s>필수항목 방명록 : 이름, 회사명(소속)&nbsp;</s></p><p><